  input: TEXT,F3XN,,"The 04/30/2005 Line 29 negative $774 entry was discussed with
    Christine Adams of the Reports Analysis Department of the FEC on 05/04/2005 and
    is being entered in accordance with her instruction. A PrinPac contribution check
    provided to a candidate more than 5 years ago was never cashed. Therefore, in
    order to bring the FEC balance and Principal Bank statement balance into agreement,
    the funds are being added back into the FEC balance at this time. Great efforts
    have been made to identify this exact contribution check, however, due to some
    extraordinary challenges, exact identification of the date and payee isn't possible
    at this time.Thank you."
